window.bookSummaryJSON = "Finding a dead body isn’t terribly unusual for Hailey Arquette. She’s a psychic private investigator. All bets are off when she discovers her partner’s classmate stuffed in a hollow tree, burned beyond recognition.<br><br>When a second student disappears, Hailey and her partner follow the trail of a ruthless criminal mastermind intent on capturing seven other students from the Gifted Elite School.<br><br>Things are never as they appear in this twisted tale of murder, mystery, betrayal, and romance. Spirits, psychics, and shifters join forces to protect psychic students from the clutches of the local mob.<br><br><br><br><br>"; 
